import React from "react";
import Slider from "react-slick";

class SliderLogos extends React.Component {
  render() {
    const settings = {
      infinite: true,
      slidesToShow: 5,
      slidesToScroll: 1,
      autoplay: true,
      autoplaySpeed: 1000,
      responsive: [
        {
          breakpoint: 768,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 1,
          },
        },
      ],
    };
    return (
      <>
        <div>
          <Slider {...settings}>
            <div className="slick-div">1</div>
            <div className="slick-div">2</div>
            <div className="slick-div">3</div>
          </Slider>
        </div>
      </>
    );
  }
}

export default SliderLogos;
